import React from 'react'

const Input = ({text1,handleChange}) => {
  return (
    <div className="input">
        <input type="text" placeholder="Enter The Task" value={text1} onChange={(e)=>handleChange(e)}></input>
        <button onClick={(e)=>Add(e)}>+</button>
      </div>
  )
}

export default Input
